    'Paperback Writer':[1966,'ポール','ジョン・ジョージ','https://beatlesdata.info/16/03_paperbackwriter.html','HTI-jqdsqQk','G1diY592_vA','4401c08DdNwwGEg8WGCkQf',"<br>Paperback writer<br><br>Dear Sir or Madam, will you read my book?<br>It took me years to write, will you take a look?<br>It's based on a novel by a man named Lear<br>And I need a job, so I want to be a paperback writer<br>Paperback writer<br><br>It's the dirty story of a dirty man<br>And his clinging wife doesn't understand<br>His son is working for the Daily Mail<br>It's a steady job but he wants to be a paperback writer<br>Paperback writer<br><br>Paperback writer<br><br>It's a thousand pages, give or take a few<br>I'll be writing more in a week or two<br>I can make it longer if you like the style<br>I can change it round and I want to be a paperback writer<br>Paperback writer<br><br>If you really like it you can have the rights<br>It could make a million for you overnight<br>If you must return it, you can send it here<br>But I need a break and I want to be a paperback writer<br>Paperback writer<br><br>Paperback writer<br><br>Paperback writer, paperback writer<br>Paperback writer, paperback writer<br>Paperback writer, paperback writer<br>Paperback writer, paperback writer (fade out)<br>"],
